import React from 'react';

import UsersLIst from '../components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: 'u1',
      name: 'Max',
      image:
        'https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.l-c-c.nl%2Fwp-content%2Fuploads%2F2019%2F11%2FIMG_5744-300x340.jpg&imgrefurl=http%3A%2F%2Fwww.l-c-c.nl%2F&tbnid=9mvvF3xfSTMtEM&vet=12ahUKEwjjm9ui9eLnAhUZd1AKHdbiAbMQMygIegUIARCbAg..i&docid=CcvwLLwkdssyCM&w=300&h=340&q=car&ved=2ahUKEwjjm9ui9eLnAhUZd1AKHdbiAbMQMygIegUIARCbAg',
      place: '3',
    },
  ];

  return <UsersLIst items={USERS} />;
};

export default Users;
